import React from 'react'
import axios from "axios"

const AllCourses = () => {
  const getCourses = ()=>{
    axios.get("http://localhost:4200/course/al-courses",{
      headers: {
          Authorization: "Bearer " + localStorage.getItem("token"),
        }
    })
  }
  return (
    <div>AllCourses</div>
  )
}

export default AllCourses
